    <title>Auth Backend</title>

    <style>
        *{
            box-sizing: border-box;
            margin:0;
            padding:0;
            font-family: Abel, sans-serif;
        }
        body{
            background-color: #202020;
            color: #fff;
            font-family: Arial, Helvetica, sans-serif;
            font-size: 16px;
            line-height: 1.6;
            margin: 0;
            padding: 0;
        }
        .main_section{
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100dvh;
            width: 100dvw;
        }
        .section_main_div{
            width: 100%;
            max-width: 1200px;
            margin: 0 auto;
            padding: 0 15px;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        .main_div{
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            gap: 2rem;
        }
        .main_img{
            width: 200px;
            height: 200px;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }
        .main_content{
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            gap:1rem;
            text-align: center;
        }
        h1{
            font-size: 3rem;
            font-weight: 700;
        }
        p{
            font-size: 1.5rem;
            font-weight: 400;
        }
    </style>
</head>
